import React from 'react'




const Select = (props) =>{

    return (

               <select onChange={props.changed} id={props.select_id}>  
                    <option value={props.selected_value}> {props.selected_value} </option>  
                    <option  value="date"> date </option> 
              </select>

        )
    }


export default Select
